description:
                                Gun Metal 1.23

Gun Metal allows players to pilot a futuristic mech which can transform into a plane. The game is based around a war (sometime in the future) on a planet called Helios, where humans have settled. 

Enemy spacecraft have followed them from Earth and are attempting to exterminate the colony. Project Gunmetal is a massive operation which oversaw the creation of a supremely powerful war machine. 


This is an exe version I put together, it's patched so that you don't need a cd in the drive.

I have setup the controls for Xbox360 controller, so if you have an Xbox360 gamepad, you're all good to go.

Enjoy this fun game, &amp; please seed for everyone else, cheers.

